INSERT INTO `index_fulltext` VALUES (9460039,'Startpage   Content Before colPos = 8           Middle 1 colPos = 20         Middle 2 colPos = 21         Middle 3 colPos = 22            Main colPos = 0        Content After colPos = 9',''),(36584950,'Events   Events calendar',''),(104320823,'Events   Paginated LIst of events      previous    1   \n						2\n					     Event 5  \n                    Event 5\n                  \n                    Event date and time:',''),(122066719,'Features   A single TYPO3 CMS installation can easily power hundreds of websites in many dozens of languages. Need more functionality? No problem! More than 1,500 open source extensions are available via Packagist and TYPO3 Extension Repository (TER).                                \n                                \n\n    \n            \n                                    Multisite\n                                \n        \n\n\n                              A single TYPO3 CMS installation can power multiple sites, efficiently sharing configuration, templates, branding, and content where needed. Point multiple domains to different entry points of your TYPO3 multisite installation.        \n                                \n\n    \n            \n                                    Multilingual\n                                \n        \n\n\n                              Deploy your content (or localised copies of your website in a multisite installation) in 56 languages. TYPO3 CMS websites and multisite installations support a variety of translation and localisation models and workflows.        \n                                \n\n    \n            \n                                    Any data, any source\n                                \n        \n\n\n                              The TYPO3 CMS file system abstraction layer can use and combine any number of file storage systems and locations while remaining completely transparent to editors. Existing file service integrations include Akamai, Alfresco, SixOMC, Cumulus, QBank DAM, Dropbox, Magento, Bynder, and Amazon S3.        \n                                \n\n    \n            \n                                    Mobile apps, responsive sites\n                                \n        \n\n\n                              Use TYPO3 CMS as the content management, business logic, and content provider for native mobile applications and front-end frameworks, as well as fully-responsive websites for website visitors and admins.        \n                                \n\n    \n            \n                                    Content history and auditing\n                                \n        \n\n\n                              TYPO3 CMS keeps a full, unlimited, auditable history of content publication and revision. Browse all changes in a visual data comparison via diff and selectively undo, or even undelete!        \n                                \n\n    \n            \n                                    On-page Search Engine Optimization (SEO)\n                                \n        \n\n\n                              A major part of getting on-page SEO right is consistency. With TYPO3 you can optimize for search engines on the go as you create individual pages with features like URL structure, page titles, and headers. It also allows you to quickly add your own meta description and meta tags.              Full Responsive Backend    The administration interface, called TYPO3 Backend, can be managed from any modern web browser, including tablets and smart phones the same way. Publishing asmall changeon-the-go or working with tablet devices to add content has never been easier.                                Runs everywhere    You can install TYPO3 by downloading  with or withoutcomposer . Putting it on a web server or on a cloud service like Microsoft Azure or Amazon AWSis simple - due to proper separation of content, configuration and other assets like caches and temporary files.Use any database you likeMySQL/MariaDB, postgreSQL, SQL Server or SQLite - due to the underlying database abstraction.   Read TYPO3 Install Guide            Reliable Upgrade Paths    From its inception TYPO3 has emphasized the importance of stable APIs and fullbackwards-compatibility. The TYPO3 core team follows a regular release schedule and take great care to ensure easy, non-breaking updates.   TYPO3 CMS Roadmap',''),(131613362,'Events   Paginated LIst of events',''),(210669803,'Feature   Content Before colPos = 8        Main colPos = 0            Special 1 colPos = 30         Special 2 colPos = 31               Special 3 colPos = 32         Special 4 colPos = 33            Main 2 colPos = 4            Special 5 colPos = 34         Special 6 colPos = 35               Special 7 colPos = 36         Special 8 colPos = 37           Content After colPos = 9',''),(211634031,'Products   ',''),(237696112,'Customize   Whether you need a blog, feedback forms, an online shop, integrations with external web services, calendars, and much more ... extensions give you a wide range of flexibility to go beyond core functionality, growing your site hand-in-hand as your business and site grow. They are the ideal building block for creating complex online solutions.                            Add functionality to the core system    There are more than 1,500 extensions available in the TYPO3 Extension Repository (TER) on TYPO3.org for you to browse and assess according to your needs. Download and install them directly with the TYPO3 backend Extension Manager. And TYPO3 is open source! You and your developers (or  your TYPO3 service provider ) can also create new, custom extensions to meet your specialised needs.    Packagist    TYPO3 Extension Repository                                  Fluid: Next Generation Templating    Fluid - TYPO3\'s next generation templating engine - is used for creating custom extension templates.  Fluid\'s approach to creating templates emphasizes simplicity, flexibility, extensibility, and easy of use. The syntax is XML-based and can be used in any Web IDE. With its ViewHelpers, Fluid can be extended by powerful functionality that fits custom web project needs.             Extensive Configuration Options    Every aspect of the TYPO3 backend is configurable and customizable. Backend interfaces can be configured using TSConfig. Rendered HTML content can be configured using TypoScript or Fluid,a standalone template engine.Checkout our documentation linked below.    Fluid    TypoScript    TSConfig    TCA    Core API',''),(248470889,'Events   Paginated List of events',''),(259253841,'Pages   TYPO3 offers the flexibility to use ready-made page layouts to have full control over the output of your content and to enable consistency. Templates are reusable and can be inherited to subpages if desired. Every website has different requirements, TYPO3 makes it possible to provide your own layouts and combine them with new designs.          Page Layouts provided by the Bootstrap Package                     \n                                        2 Columns 50/50\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        Default\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        2 Columns\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        2 Columns 25/75\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        2 Columns, Offset Right\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        3 Columns\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        Simple\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        Subnavigation, Left\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        Subnavigation, Left and 2 Columns\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        Subnavigation, Right\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        Subnavigation, Right and 2 Columns\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        Feature\n                                         \n                                \n                                        See Example\n                                    \n                                                 \n                                        Startpage\n                                         \n                                \n                                        See Example\n                                    \n                                          Ready to create your own Template?    Checkout our documentation on SitePackages with a ste by step tutorial for turning a basic design template (HTML, CSS, JavaScript files, etc.) into a fully working, mobile-responsive website powered by TYPO3.   SitePackage Tutorial',''),(263105595,'Congratulations ,This website is a default website setup for TYPO3. You can use it to demonstrate the basic features of the TYPO3 Content Management System, but you are also welcome to use it as a basis for your own website projects. Please have a look at how it works and how it is structured. In building this package, we have tried to combine a lot of best practices. Feel free to use these structures and use elements of it for your own way of working. , typo3, introduction package, install, example setup Possibilities    With a rich core feature set out-of-the-box, TYPO3 is an ideal choice for building ambitious digital experiences.   Features  Customizing                        Examples    Don\'t hesitate and discover the large selection of our pre-configured page layouts and content elements.   Pages  Content                          Playground    Build any web application you can imagine. Explore the Backend and experience the enormous flexibility.   Log into TYPO3                                    Deliver business value    Start small and scale as you grow with TYPO3 CMS. Your initial, simple TYPO3 website will keep pace with you as your needs grow. It offers powerful multilingual and multisite features to help you reach a global audience and create new websites with ease. TYPO3 provides proven return on investment with stable long-term installations and clean upgrade paths, while remaining flexible enough to support innovation.','');
