INSERT INTO `sys_template` VALUES (1,1,1569172817,1567345746,1,1,0,0,0,0,'This is an Empty Site Package TypoScript template.\n\nFor each website you need a TypoScript template on the main page of your website (on the top level). For better maintenance all TypoScript should be extracted into external files via @import \'EXT:site_myproject/Configuration/TypoScript/setup.typoscript\'',0,0,0,'',0,0,0,0,0,0,'Main TypoScript Rendering','New TYPO3 Console site',1,1,'EXT:fluid_styled_content/Configuration/TypoScript/,EXT:fluid_styled_content/Configuration/TypoScript/Styling/','','page = PAGE\npage.10 = TEXT\npage.10.value (\n   <div style=\"width: 800px; margin: 15% auto;\">\n      <div style=\"width: 300px;\">\n        <svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 150 42\"><path d=\"M60.2 14.4v27h-3.8v-27h-6.7v-3.3h17.1v3.3h-6.6zm20.2 12.9v14h-3.9v-14l-7.7-16.2h4.1l5.7 12.2 5.7-12.2h3.9l-7.8 16.2zm19.5 2.6h-3.6v11.4h-3.8V11.1s3.7-.3 7.3-.3c6.6 0 8.5 4.1 8.5 9.4 0 6.5-2.3 9.7-8.4 9.7m.4-16c-2.4 0-4.1.3-4.1.3v12.6h4.1c2.4 0 4.1-1.6 4.1-6.3 0-4.4-1-6.6-4.1-6.6m21.5 27.7c-7.1 0-9-5.2-9-15.8 0-10.2 1.9-15.1 9-15.1s9 4.9 9 15.1c.1 10.6-1.8 15.8-9 15.8m0-27.7c-3.9 0-5.2 2.6-5.2 12.1 0 9.3 1.3 12.4 5.2 12.4 3.9 0 5.2-3.1 5.2-12.4 0-9.4-1.3-12.1-5.2-12.1m19.9 27.7c-2.1 0-5.3-.6-5.7-.7v-3.1c1 .2 3.7.7 5.6.7 2.2 0 3.6-1.9 3.6-5.2 0-3.9-.6-6-3.7-6H138V24h3.1c3.5 0 3.7-3.6 3.7-5.3 0-3.4-1.1-4.8-3.2-4.8-1.9 0-4.1.5-5.3.7v-3.2c.5-.1 3-.7 5.2-.7 4.4 0 7 1.9 7 8.3 0 2.9-1 5.5-3.3 6.3 2.6.2 3.8 3.1 3.8 7.3 0 6.6-2.5 9-7.3 9\"/><path fill=\"#FF8700\" d=\"M31.7 28.8c-.6.2-1.1.2-1.7.2-5.2 0-12.9-18.2-12.9-24.3 0-2.2.5-3 1.3-3.6C12 1.9 4.3 4.2 1.9 7.2 1.3 8 1 9.1 1 10.6c0 9.5 10.1 31 17.3 31 3.3 0 8.8-5.4 13.4-12.8M28.4.5c6.6 0 13.2 1.1 13.2 4.8 0 7.6-4.8 16.7-7.2 16.7-4.4 0-9.9-12.1-9.9-18.2C24.5 1 25.6.5 28.4.5\"/></svg>\n      </div>\n      <h4 style=\"font-family: sans-serif;\">Welcome to a default website made with <a href=\"https://typo3.org\">TYPO3</a></h4>\n   </div>\n)\npage.100 =< styles.content.get','',NULL,0,0,0),(2,67,1567346035,1567346035,2,0,0,0,0,256,NULL,0,0,0,'',0,0,0,0,0,0,'Grid Example (overrides content selection for subpages)','',0,0,'',NULL,'[treeLevel = 2]\n# DEMO CSS\npage.cssInline {\n    100 = TEXT\n    100.value (\n    .example-grid { border: 1px solid rgba(117, 167, 90, 0.5); background-color: rgba(117, 167, 90, 0.25); padding: 2em; }\n    )\n}\n\n# Override Content Selection\nlib.dynamicContent >\nlib.dynamicContent = COA\nlib.dynamicContent {\n    5 = LOAD_REGISTER\n    5 {\n        colPos.cObject = TEXT\n        colPos.cObject {\n            field = colPos\n            ifEmpty.cObject = TEXT\n            ifEmpty.cObject {\n                value.current = 1\n                ifEmpty = 0\n            }\n        }\n    }\n    10 = CASE\n    10 {\n        key.data = register:colPos\n        0 = TEXT\n        0.value = Main\n        1 = TEXT\n        1.value = Left\n        2 = TEXT\n        2.value = Right\n        3 = TEXT\n        3.value = Border\n        4 = TEXT\n        4.value = Main 2\n        8 = TEXT\n        8.value = Content Before\n        9 = TEXT\n        9.value = Content After\n        10 = TEXT\n        10.value = Footer 1\n        11 = TEXT\n        11.value = Footer 2\n        12 = TEXT\n        12.value = Footer 3\n        20 = TEXT\n        20.value = Middle 1\n        21 = TEXT\n        21.value = Middle 2\n        22 = TEXT\n        22.value = Middle 3\n        30 = TEXT\n        30.value = Special 1\n        31 = TEXT\n        31.value = Special 2\n        32 = TEXT\n        32.value = Special 3\n        33 = TEXT\n        33.value = Special 4\n        34 = TEXT\n        34.value = Special 5\n        35 = TEXT\n        35.value = Special 6\n        36 = TEXT\n        36.value = Special 7\n        37 = TEXT\n        37.value = Special 8\n        38 = TEXT\n        38.value = Special 9\n        39 = TEXT\n        39.value = Special 10		\n		wrap = <div>|</div>\n    }\n    11 = TEXT\n    11 {\n        value = colPos = {register:colPos}\n        value.insertData = 1\n        wrap = <div>|</div>\n    }\n    90 = RESTORE_REGISTER\n    wrap (\n        <div class=\"frame frame-default frame-type-html frame-layout-0 frame-background-none frame-no-backgroundimage frame-space-before-none frame-space-after-none\">\n            <div class=\"frame-inner\">\n                <div class=\"example-grid\">|</div>\n            </div>\n        </div>\n    )\n}\nlib.dynamicContentSlide =< lib.dynamicContent\nlib.dynamicContentSlide {\n	20 = TEXT\n	20.value = If no content element is found in this column, the rootLine will be traversed back until some content is found.\n	20.wrap = <div>|</div>\n}\n[global]','','',0,0,2),(3,2,1567346035,1567346035,2,0,0,0,0,256,'',0,0,0,'',0,0,0,0,0,0,'Introduction Package','TYPO3 CMS - Introduction Package',1,3,'EXT:bootstrap_package/Configuration/TypoScript','[treeLevel = 0]\npage.theme.navigation.style = default-transition\n[end]\npage.theme.navigation.type = top\npage.theme.meta.enable = 0\npage.logo.file = fileadmin/introduction/images/introduction-package.svg\npage.logo.fileInverted = fileadmin/introduction/images/introduction-package-inverted.svg\nplugin.bootstrap_package.settings.scss.primary = #75a75a\nplugin.bootstrap_package.settings.scss.secondary = #333333\npage.theme.socialmedia.channels.facebook.url = https://www.facebook.com/typo3/\npage.theme.socialmedia.channels.twitter.url = https://twitter.com/typo3\npage.theme.socialmedia.channels.github.url = https://github.com/TYPO3/TYPO3.CMS\npage.theme.socialmedia.channels.youtube.url = https://www.youtube.com/user/typo3\npage.theme.cookieconsent.position = bottom-right\npage.preloader.backgroundColor = #75A75A\npage.preloader.logo.file = fileadmin/introduction/images/introduction-package-inverted.svg','','','',0,0,1),(4,94,1569602655,1569174399,1,0,0,0,0,256,NULL,0,0,0,'',0,0,0,0,0,0,'Events app template','Events app',1,3,'EXT:bootstrap_package/Configuration/TypoScript','page.logo.file = \npage.logo.fileInverted = \npage.theme.navigation.icon.enable = 0\nplugin.bootstrap_package_contentelements.header.defaultHeaderType = 1\npage.logo.height = 30\npage.fluidtemplate.layoutRootPath = fileadmin/event_app_package/Resources/Private/Layouts/Page/\nplugin.bootstrap_package.view.layoutRootPath = fileadmin/event_app_package/Resources/Private/Layouts/\nplugin.bootstrap_package.view.templateRootPath = fileadmin/event_app_package/Resources/Private/Templates/\npage.fluidtemplate.templateRootPath = fileadmin/event_app_package/Resources/Private/Templates/Page','','','',0,0,0),(5,94,1569601891,1569601891,1,0,0,0,0,512,NULL,0,0,0,'',0,0,0,0,0,0,'+ext','',0,0,NULL,NULL,NULL,'','',0,0,0);
