arkup used to indicate a word as a variable).</li>\n    <li> In order to test how subscripts and superscripts (<code>sub</code> and <code>sup</code> markup) work inside running text,\n        we need some dummy text around constructs like x<sub>1</sub> and H<sub>2</sub>O (where subscripts occur). So here\n        is some fill so that you will (hopefully) see whether and how badly the subscripts and superscripts mess up vertical\n        spacing between lines. Now superscripts: M<sup>lle</sup>, 1<sup>st</sup>, and then some mathematical notations: e<sup>x</sup>,\n        sin<sup>2</sup> <i>x</i>, and some nested superscripts (exponents) too: Lorem ipsum dolor sit amet, consectetuer\n        adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim\n        ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea euismod tincidunt\n        ut laoreet dolore magna aliquam erat volutpat. </li>\n\n</ul>\n\n<p>Some of the elements tested above are typically displayed in a monospace font, often using the <em>same</em> presentation\n    for all of them. This tests whether that is the case on your browser:</p>\n\n<ul>\n    <li><code>This is sample text inside code markup</code></li>\n    <li><kbd>This is sample text inside kbd markup</kbd></li>\n    <li><samp>This is sample text inside samp markup</samp></li>\n\n    <li><tt>This is sample text inside tt markup</tt></li>\n</ul>\n\n<h2>Links</h2>\n\n<ul>\n    <li><a href=\"http:///web/20110926020946/http://developer.yahoo.com/yui\">developer.yahoo.com/yui</a></li>\n    <li><a href=\"http:///web/20110926020946/http://yuiblog.com/\">the YUI Blog</a></li>\n</ul>\n\n\n<h2>Tables</h2>\n\n<p>The following table has a caption. The first row and the first column contain table header cells only; other cells are data\n    cells.</p>\n\n<table summary=\"each row names a nordic country and specifies its total area and land area, in square kilometers\">\n    <caption>Caption: Sample table: Areas of the Nordic countries, in sq km</caption>\n    <tr>\n        <th>Country</th>\n        <th>Total area</th>\n\n        <th>Land area</th>\n    </tr>\n    <tr>\n        <th>Denmark</th>\n        <td>43,070</td>\n        <td>42,370</td>\n    </tr>\n    <tr>\n\n        <th>Finland</th>\n        <td>337,030</td>\n        <td>305,470</td>\n    </tr>\n    <tr>\n        <th>Iceland</th>\n        <td>103,000</td>\n\n        <td>100,250</td>\n    </tr>\n    <tr>\n        <th>Norway</th>\n        <td>324,220</td>\n        <td>307,860</td>\n    </tr>\n\n    <tr>\n        <th>Sweden</th>\n        <td>449,964</td>\n        <td>410,928</td>\n    </tr>\n</table>\n\n<h2>Forms</h2>\n\n<form action=\"/web/20110926020946/http://www.cs.tut.fi/cgi-bin/run/~jkorpela/echo.cgi\">\n\n    <div><input type=\"hidden\" name=\"hidden field\" value=\"42\"></div>\n    <div><label for=\"f1\">Single-line text input field: <input id=\"f1\" name=\"text\" size=\"20\" value=\"Default text.\"></label></div>\n    <div><label for=\"f2\">Multi-line text input field (textarea):</label></div>\n    <div><textarea id=\"f2\" name=\"textarea\" rows=\"16\" cols=\"20\">Default text.</textarea></div>\n\n    <p>The following two radio buttons are inside <code>fieldset</code> element with a <code>legend</code>:</p>\n\n\n    <fieldset>\n        <legend>Legend</legend>\n        <div>\n            <label for=\"f3\">Radio button 1</label>\n            <input id=\"f3\" type=\"radio\" name=\"radio\" value=\"1\">\n        </div>\n        <div>\n            <label for=\"f4\">Radio button 2 (initially checked)</label>\n\n            <input id=\"f4\" type=\"radio\" name=\"radio\" value=\"2\" checked>\n        </div>\n    </fieldset>\n\n    <fieldset>\n        <legend>Check those that apply</legend>\n        <div>\n            <label for=\"f5\">Checkbox 1</label>\n\n            <input id=\"f5\" type=\"checkbox\" name=\"checkbox\">\n        </div>\n        <div>\n            <label for=\"f6\">Checkbox 2 (initially checked)</label>\n            <input id=\"f6\" type=\"checkbox\" name=\"checkbox2\" checked>\n        </div>\n    </fieldset>\n\n    <p>\n\n        <label for=\"f10\">A <code>select</code> element with <code>size=\"1\"</code> (dropdown box):</label>\n    </p>\n\n    <select id=\"f10\" name=\"select1\" size=\"1\">\n      <option>one</option>\n\n      <option selected>two (default)</option>\n      <option>three</option>\n    </select>\n\n    <p>\n        <label for=\"f11\">A <code>select</code> element with <code>size=\"3\"</code> (listbox):</label>\n\n    </p>\n\n    <select id=\"f11\" name=\"select2\" size=\"3\">\n      <option>one</option>\n      <option selected>two (default)</option>\n      <option>three</option>\n    </select>\n\n    <div>\n        <label for=\"f99\">Submit button:</label>\n        <input id=\"f99\" type=\"submit\" name=\"submit\" value=\"Just a test\">\n    </div>\n    <div>\n        <label for=\"f0\">Reset button:</label>\n        <input id=\"f0\" type=\"reset\" name=\"reset\" value=\"Reset\">\n    </div>\n</form>\n\n\n<p>This next bit shows that PREformatted text is working.</p>\n\n<pre>\n1\n 2\n  3\n   4\n    5\n</pre>\n\n<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna\n    aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut\n    aliquip ex ea commodo consequat. Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat,\n    vel illum dolore eu feugiat nulla facilisis at vero eros et accumsan et iusto odio dignissim qui blandit praesent luptatum\n    zzril delenit Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet\n    dolore magna aliquam erat volutpat.</p>\n<marquee><pre>\n||\n|    TYPO3!!       | \n||\n(\\__/) ||\n() ||\n/  </pre></marquee>',0,0,0,0,0,0,0,2,0,0,0,'default'