INSERT INTO `tx_bootstrappackage_card_group_item` VALUES (1,82,1567346035,1567346035,2,0,0,0,0,6,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,4,'On-page Search Engine Optimization (SEO)','',0,'<p>A major part of getting on-page SEO right is consistency. With TYPO3 you can optimize for search engines on the go as you create individual pages with features like URL structure, page titles, and headers. It also allows you to quickly add your own meta description and meta tags.</p>','','',0,'default'),(2,82,1567346035,1567346035,2,0,0,0,0,5,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,4,'Content history and auditing','',0,'<p>TYPO3 CMS keeps a full, unlimited, auditable history of content publication and revision. Browse all changes in a visual data comparison via diff and selectively undo, or even undelete!</p>','','',0,'default'),(3,82,1567346035,1567346035,2,0,0,0,0,4,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,4,'Mobile apps, responsive sites','',0,'<p>Use TYPO3 CMS as the content management, business logic, and content provider for native mobile applications and front-end frameworks, as well as fully-responsive websites for website visitors and admins.</p>','','',0,'default'),(4,82,1567346035,1567346035,2,0,0,0,0,3,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,4,'Any data, any source','',0,'<p>The TYPO3 CMS file system abstraction layer can use and combine any number of file storage systems and locations while remaining completely transparent to editors. Existing file service integrations include Akamai, Alfresco, SixOMC, Cumulus, QBank DAM, Dropbox, Magento, Bynder, and Amazon S3.</p>','','',0,'default'),(5,82,1567346035,1567346035,2,0,0,0,0,2,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,4,'Multilingual','',0,'<p>Deploy your content (or localised copies of your website in a multisite installation) in 56 languages. TYPO3 CMS websites and multisite installations support a variety of translation and localisation models and workflows.</p>','','',0,'default'),(6,82,1567346035,1567346035,2,0,0,0,0,1,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,4,'Multisite','',0,'<p>A single TYPO3 CMS installation can power multiple sites, efficiently sharing configuration, templates, branding, and content where needed. Point multiple domains to different entry points of your TYPO3 multisite installation.</p>','','',0,'default'),(7,54,1567346035,1567346035,2,0,0,0,0,4,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,95,'Card title','',0,'<p>Some quick example text to build on the card title and make up the bulk of the card\'s content.</p>','','',0,'primary'),(8,54,1567346035,1567346035,2,0,0,0,0,3,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,95,'Card title','',0,'<p>Some quick example text to build on the card title and make up the bulk of the card\'s content.</p>','','',0,'primary'),(9,54,1567346035,1567346035,2,0,0,0,0,3,0,0,'a:2:{s:10:\"tt_content\";N;s:5:\"image\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,96,'Card title','',1,'<p>Some quick example text to build on the card title and make up the bulk of the card\'s content.</p>','','',0,'primary'),(10,54,1567346035,1567346035,2,0,0,0,0,2,0,0,'a:1:{s:10:\"tt_content\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,95,'Card title','',0,'<p>Some quick example text to build on the card title and make up the bulk of the card\'s content.</p>','','',0,'primary'),(11,54,1567346035,1567346035,2,0,0,0,0,2,0,0,'a:1:{s:4:\"link\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,97,'Card title','Card subtitle',0,'<p>Some quick example text to build on the card title and make up the bulk of the card\'s content.</p>','t3://page?uid=186','Go somewhere',0,'primary'),(12,54,1567346035,1567346035,2,0,0,0,0,2,0,0,'a:2:{s:10:\"tt_content\";N;s:5:\"image\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,96,'Card title','',1,'<p>Some quick example text to build on the card title and make up the bulk of the card\'s content.</p>','','',0,'primary'),(13,54,156